import React, { useState, useEffect } from 'react';
import { COMPETITION_POINTS, MEET_LABELS } from './utils/competitionPoints';

function CompetitionTable({ 
  points,
  eventType, 
  onCalculatePerformance,
}) {
  const [baseMeet, setBaseMeet] = useState('');
  const [basePlace, setBasePlace] = useState('');
  const [performance, setPerformance] = useState('');

  const calculateEquivalentPerformance = async () => {
    if (!baseMeet || !basePlace) return;

    const totalPoints = (points || 0) + (COMPETITION_POINTS[baseMeet][basePlace] || 0);

    try {
      const response = await fetch('http://localhost:5001/api/calculate-performance', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          points: totalPoints,
          event_type: eventType,
        }),
      });

      const data = await response.json();
      setPerformance(data.performance);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  useEffect(() => {
    if (points && eventType && baseMeet && basePlace) {
      calculateEquivalentPerformance();
    }
  }, [points, eventType, baseMeet, basePlace]);

  return (
    <div className="competition-page">
      <div className="competition-main">
        <h2>Competition Level Comparison</h2>

        {/* First table - just showing performance points + placement points */}
        <div className="base-points-section">
          <h3>Base Performance Points</h3>
          <div className="points-display">
            {points || 'Enter performance'}
          </div>
        </div>

        <h3>Total Points (Performance + Placement)</h3>
        <table className="competition-table">
          <thead>
            <tr>
              <th>Place</th>
              {Object.keys(MEET_LABELS).map(code => (
                <th key={code}>{MEET_LABELS[code]}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {[...Array(16)].map((_, index) => {
              const place = index + 1;
              return (
                <tr key={place}>
                  <td>{place}</td>
                  {Object.keys(COMPETITION_POINTS).map(level => (
                    <td key={level}>
                      {COMPETITION_POINTS[level][place] 
                        ? (points || 0) + COMPETITION_POINTS[level][place]
                        : '-'}
                    </td>
                  ))}
                </tr>
              );
            })}
          </tbody>
        </table>

        {/* Second table - keep exactly as is */}
        <div className="equivalent-points-section">
          <h3>Calculate Required Performance</h3>
          <div className="meet-selection">
            <select value={baseMeet} onChange={(e) => setBaseMeet(e.target.value)}>
              <option value="">Select Meet Level</option>
              {Object.keys(COMPETITION_POINTS).map(level => (
                <option key={level} value={level}>{MEET_LABELS[level]}</option>
              ))}
            </select>
            <select value={basePlace} onChange={(e) => setBasePlace(e.target.value)}>
              <option value="">Select Place</option>
              {baseMeet && Object.keys(COMPETITION_POINTS[baseMeet]).map(place => (
                <option key={place} value={place}>Place {place}</option>
              ))}
            </select>
          </div>

          {baseMeet && basePlace && (
            <div className="equivalent-points">
              <p>
                Total Points: {(points || 0) + (COMPETITION_POINTS[baseMeet][basePlace] || 0)}
                {' '}({points || 0} + {COMPETITION_POINTS[baseMeet][basePlace]})
              </p>
              <p>
                Required Performance: {performance}
              </p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default CompetitionTable;
